import React from "react";
import "./card.css";

export default function Image({ image }) {
  return (
    <div className="artsyCard">
      <img className="image" src={image.urls.regular} alt="" />
      <div className="overlay">
        <div className="text">Description</div>
      </div>
    </div>
  );
}
